import '../css/Hangman.css';
import React, { Component } from 'react';

interface AppProps {}

interface AppState {
  word: string;
  currentLetters: string[];
  fails: number;
}

class Hangman extends Component<AppProps, AppState> {
  constructor(props: AppProps) {
    super(props);

    this.state = {
      word: '',
      currentLetters: [],
      fails: 0
    };
  }

  setWord(word: string): void {
    this.setState({ word: word });
  }

  get length(): number {
    return this.state.word.length;
  }

  render() {
    return <div>Hangman Function</div>;
  }
}

export default Hangman;
